package org.yqian.job.service;

import lombok.extern.slf4j.Slf4j;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.TestInstance;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import org.yqian.job.entity.BidEntity;
import org.yqian.job.entity.JobEntity;
import org.yqian.job.repository.BidRepository;
import org.yqian.job.repository.JobRepository;

import java.util.ArrayList;
import java.util.List;
import java.util.Optional;
import java.util.Random;

import static org.assertj.core.api.Assertions.assertThat;
import static org.mockito.BDDMockito.given;
import static org.mockito.Mockito.times;
import static org.mockito.Mockito.verify;

@Slf4j
@ExtendWith(MockitoExtension.class)
@TestInstance(TestInstance.Lifecycle.PER_CLASS)
public class JobServiceTest {

    @Mock
    private JobRepository mockJobRepository;

    @Mock
    private BidRepository mockBidRepository;

    @Mock
    private MailService mockMailService;
    @InjectMocks
    private JobService jobService;

    @Test
    public void testPostJob() {
        JobEntity job = new JobEntity();
        job.setName("New Job");
        job.setDescription("");
        job.setRequirement("");
        given(mockJobRepository.save(job)).willReturn(job);
        JobEntity result = jobService.postJob(job);
        assertThat(result.getName()).isEqualTo("New Job");
    }

    @Test
    public void testFindMostActiveJobs() {
        List<JobEntity> jobEntityList = new ArrayList<>();
        jobEntityList.add(new JobEntity());
        given(mockJobRepository.findMostActiveJobs()).willReturn(jobEntityList);
        List<JobEntity> result = jobService.findMostActiveJobs();
        assertThat(result).isNotEmpty();
    }

    @Test
    public void testFindMostRecentJobs() {
        List<JobEntity> jobEntityList = new ArrayList<>();
        jobEntityList.add(new JobEntity());
        given(mockJobRepository.findMostRecentJobs()).willReturn(jobEntityList);
        List<JobEntity> result = jobService.findMostRecentJobs();
        assertThat(result).isNotEmpty();
    }

    @Test
    public void testExpiredJobs() {
        List<JobEntity> jobEntityList = new ArrayList<>();
        jobEntityList.add(new JobEntity());
        given(mockJobRepository.findAllExpiredJobs()).willReturn(jobEntityList);
        List<JobEntity> result = jobService.findAllExpiredJobs();
        assertThat(result).isNotEmpty();
    }

    @Test
    public void testCloseJob() {
        BidEntity bid = new BidEntity();
        bid.setEmail("email@email");
        given(mockBidRepository.findById(new Integer(0))).willReturn(Optional.of(bid));
        jobService.closeJob(new JobEntity());
        verify(mockMailService, times(1)).sendEmail("email@email");
    }

    @Test
    public void stringGenerator() {
        Random random = new Random();

        String generatedString = random.ints(48, 123)
                .filter(i -> (i <= 57 || i >= 65) && (i <= 90 || i >= 97))
                .limit(20000)
                .collect(StringBuilder::new, StringBuilder::appendCodePoint, StringBuilder::append)
                .toString();

        log.info(generatedString);
    }
}
